@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

atm:ATM a owl:Class .
atm:BankComputer a owl:Class .
atm:Transaction a owl:Class .
atm:Account a owl:Class .
atm:Request a owl:Class .
atm:Message a owl:Class .

atm:processesTransaction a owl:ObjectProperty ;
  rdfs:domain atm:BankComputer ;
  rdfs:range atm:Transaction .

atm:hasRequest a owl:ObjectProperty ;
  rdfs:domain atm:ATM ;
  rdfs:range atm:Request .

atm:hasTransaction a owl:ObjectProperty ;
  rdfs:domain atm:Request ;
  rdfs:range atm:Transaction .

atm:hasAccount a owl:ObjectProperty ;
  rdfs:domain atm:Transaction ;
  rdfs:range atm:Account .

atm:hasAmount a owl:DatatypeProperty ;
  rdfs:domain atm:Transaction ;
  rdfs:range xsd:decimal .

atm:sendsMessage a owl:ObjectProperty ;
  rdfs:domain atm:BankComputer ;
  rdfs:range atm:Message .

atm:transactionSucceeded a owl:DatatypeProperty ;
  rdfs:domain atm:Transaction ;
  rdfs:range xsd:boolean .
